result:
.active{
    background: #0091FF;
    box-shadow:0px 6px 20px 0px rgba(0, 145, 255, 0.3);
    color: #fff !important;
}
.list-goods-list-item{
    border: 1px solid #DADFE6;
    padding: 20px 10px;
    box-sizing: border-box;
    border-radius:3px;
}
.list-goods-list{
    &-item{
        text-align: center;
        position: relative;
        cursor: pointer;
        img{
            width: 60%;
        }
        .ivu-tag{
            position: absolute;
            top: 10px;
            right: 10px;
        }
        &-title{
            font-size: 16px;
            font-weight: bold;
            color: #0091FF;
            margin-bottom: 3px;
            i{
                font-size: 30px;
                font-style: normal;
            }
        }
        &-desc{
            font-size: 14px;
            color: #808695;
        }
        &-price{
            font-size: 14px;
            color: #000000;
            s{
                color: #c5c8ce;
            }
        }
        &-number{
            font-size: 14px;
            color: #ED4014;
        }
        &-pay{
            font-size: 14px;
            color: #00C050;
            i{
                font-size: 12px;
                font-style: normal;
                color: #6D7278;
            }
        }
        &-code{
            width: 130px;
            height: 130px;
            img{
                width: 100%;
                height: 100%;
            }
        }
    }
}
.new_tab {
    >>>.ivu-tabs-nav .ivu-tabs-tab{
        padding:4px 16px 20px !important;
        font-weight: 500;
    }
}
